var show_msg = function (_msg,_status) {        
    var $msg_bar = (_status)?jQuery('.alert-success'):jQuery('.alert-danger') ;
    $msg_bar.find('.text').html(_msg);
    $msg_bar.removeClass('hide');
    window.setTimeout(function(){
        $msg_bar.addClass('hide');
    }, 4000);
};

